termsFooter_howItWorks_text:
Vilkite ir meskite failus į nurodytą sritį arba pasirinkite juos tradiciniu būdu; failai bus užšifruoti ir išsiųsti į serverį. Gausite dvi nuorodas į failą:
Atsisiuntimo nuorodą, kurią galėsite bendrinti su žmonėmis;
ir ištrynimo nuorodą, kuria bet kada galėsite ištrinti failą.
